import Link from 'next/link';

const House = props => {
  return (
    <li>
      <Link href='/houses/[id]' as={`/houses/${props.id}`}>
        <a>
          <div>
            <img src={props.picture} width='100%' alt='Host Image' />
            <p>
              {props.type} - {props.town}
            </p>
            <p>{props.title}</p>
            <p>
              {props.rating} ({props.reviewsCount})
            </p>
          </div>
        </a>
      </Link>
    </li>
  );
};

export default House;
